import React from "react";
import { Modal } from "react-bootstrap";
import { Button } from "react-bootstrap";

const ViewExpense = (props) => {
    const data = props.data;
  return (
    <Modal onHide={props.onHide} show={props.show} size="lg" backdrop="static">
      <Modal.Header closeButton>
        <Modal.Title>Expense Entry</Modal.Title>
      </Modal.Header>
      <Modal.Body>
          Employee Name : {data.employee.firstName + " " + data.employee.lastName}
          Entry Date : {data.date}
          Total Reimbursement : {data.currency + " " + data.amount}
          Status : {data.status}
      </Modal.Body>

      <Modal.Footer>
        <Button
          variant="primary"
          //   onClick={handleSubmit}
        >
          Print
        </Button>
        <Button variant="secondary" onClick={props.onHide}>
          Close
        </Button>
      </Modal.Footer>
    </Modal>
  );
};

export default ViewExpense;
